import React, { Component } from "react";
import "./ProfileModal.css";

class ProfileModal extends Component {
  state = {};
  render() {
    return (
      <div className="mod-profile">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg ml-4 ">
                <i className="fa fa-file-text float-left mt-2"></i>
                <p className="">My Bio</p>
              </div>
            </div>
            <div className="row">
              <div className="col-lg">
                <div class="input-group ">
                  <div class="input-group-prepend ml-5">
                    <span
                      class="input-group-text"
                      style={{
                        background: "white",
                        border: "none",
                      }}
                    >
                        <i>
                        <i className="fa fa-heart-o"
                        style={{color: "red",background: "pink"}}
                        ></i>                    
                      Name :
                        </i>
                    </span>
                  </div>
                  <input
                    type="text"
                    aria-label="First name"
                    class="form-control shadow-none"
                    style={{ border: "none" }}
                    placeholder ="Hamna Zaidah"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ProfileModal;
